import React from 'react'

function RedirectPage() {
  return (
    <div>
        {
            fetch("./url.json")
            .then(response => response.json())
            .then(data => {
              console.log(data)
            })
            .catch(error => {
              console.error('Error fetching data:', error);
              // Handle the error, e.g., show an error message to the user
            })
          
        }
    </div>
  )
}

export default RedirectPage
